import * as React from 'react';
import './App.css';
import Project from './Project';
import Nav from './Nav';
import "./assets/fonts/AzeretMono-Regular.ttf";
import "./assets/fonts/AzeretMono-Bold.ttf";

function App() {
  return (
    <div className="App container">
      <div className="row">
        <Nav />
        <div className="projectContainer col-lg-10">
          <div className="row row-cols-1 row-cols-lg-2 g-3">
            <Project
              img="GrowthTracker.png"
              alt="Growth Tracker Extension"
              projName="Growth Tracker"
              projSubHead="Browser Extension"
              projDesc="Journal and mood tracker for Firefox and Chrome."
              projTech="JavaScript, HTML, CSS"
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
